    // </div>
    <div className="grid-api">
      {state.map((elem ,index)=>{
        let {id,title,image}=elem
        return(
            <>
              <div  className="grid-back">
                <div className="in">{index}</div>
                 <img className="grid-img"  src={image} alt="img" />
                <div>{id}.{title}</div>
               </div>
            </>
